// SPDX-License-Identifier: MIT
pragma solidity ^0.8.17;

contract StockTrading {

    struct Stock{
        uint256 price;
        uint256 quantity;
    }

    struct Order {
        address trader;
        uint256 price;
        uint256 quantity;
    }


    mapping(string=>Stock) public stocks;
    mapping(address=>mapping(string=>uint256)) public balances;

    mapping(string => Order[]) public buyOrderBook;
    mapping(string => Order[]) public sellOrderBook;


    function placeBuyOrder(string memory stockName, uint256 price, uint256 quantity) public payable{

        Order[] storage sellOrders = sellOrderBook[stockName];

        uint256 remainingQuantity = quantity;
        for(uint256 i = 0; i < sellOrders.length && remainingQuantity > 0; i++) {
            Order storage sellOrder = sellOrders[i];
            if(sellOrder.price <= price) {
                uint256 quantityToBuy = sellOrder.quantity < remainingQuantity ? sellOrder.quantity : remainingQuantity;

                remainingQuantity -= quantityToBuy;
                sellOrder.quantity -= quantityToBuy;
                

                balances[msg.sender][stockName] += quantityToBuy;
                balances[sellOrder.trader][stockName] -= quantityToBuy;

                if(sellOrder.quantity == 0) {
                    // for (uint256 j = i; j < sellOrders.length - 1; j++) {
                    //     sellOrders[j] = sellOrders[j + 1];
                    // }
                    removeOrder(sellOrders,i);
                    sellOrders.pop();
                    i--;
                }
            }
        }

        if(remainingQuantity > 0) {
            Order memory newBuyOrder = Order(msg.sender, price, remainingQuantity);
            buyOrderBook[stockName].push(newBuyOrder);
        }

    }

    function placeSellOrder(string memory stockName, uint256 price, uint256 quantity) public payable{

        Order[] storage buyOrders = buyOrderBook[stockName];

        uint256 remainingQuantity = quantity;
        for (uint256 i = 0; i < buyOrders.length && remainingQuantity > 0; i++) {
            Order storage buyOrder = buyOrders[i];
            if (buyOrder.price >= price) {
                // Calculate how much quantity can be sold to this buy order
                uint256 quantityToSell = buyOrder.quantity < remainingQuantity ? buyOrder.quantity : remainingQuantity;

                // Perform the trade
                // (You may need to transfer tokens and handle trader balances accordingly)
                // For this example, we'll simply update the remaining quantity and buy order quantity
                remainingQuantity -= quantityToSell;
                buyOrder.quantity -= quantityToSell;

                balances[msg.sender][stockName] -= quantityToSell;
                balances[buyOrder.trader][stockName] -= quantityToSell;

                // If the buy order quantity becomes zero, remove the order
                if (buyOrder.quantity == 0) {
                    //buyOrders[i] = buyOrders[buyOrders.length - 1];
                    //buyOrders.pop();
                    removeOrder(buyOrders,i);
                    i--; // Adjust the loop counter as the last element is moved to the current index
                }
            }
        }

        // If there is any remaining quantity, store it in sellOrderBook
        if (remainingQuantity > 0) {
            Order memory newSellOrder = Order(msg.sender, price, remainingQuantity);
            sellOrderBook[stockName].push(newSellOrder);
        }

    }

    function removeOrder(Order[] storage orders, uint256 index) internal {
        if (index < orders.length - 1) {
            orders[index] = orders[orders.length - 1];
        }
        orders.pop();
    }

    function addStock(string memory stockName, uint256 price, uint256 quantity) public {
        require(stocks[stockName].price == 0, "Stock already exists");

        stocks[stockName] = Stock(price, quantity);

        Order memory sellOrder = Order(msg.sender, price, quantity);
        sellOrderBook[stockName].push(sellOrder);
    }

    function updateStockPrice(string memory stockName, uint256 price) public {
        require(stocks[stockName].price > 0, "Stock not dound");

        stocks[stockName].price = price;
    }
}

